sys_variable_value.value:
// Creates update set in the development environment
workflow.scratchpad.answer = (new x_wms_pulse.PulseUtils()).createRemoteUpdateSet(current);

if (workflow.scratchpad.answer.message) {
	current.work_notes = workflow.scratchpad.answer.message;
}
if (!workflow.scratchpad.answer.success) {
	current.setValue('state', DevRequestStates.AUTOMATION_FAILURE);
}

